import React, { Component } from "react";
import Questions from './Questions'
import Procedure from './Procedure'
import "./App.css";

class App extends Component {
  render() {
    return (
        <div class="container">
        <div class="row">
          <div class="col">
            <Procedure></Procedure> 
          </div>
          <div class="col">
            <Questions></Questions>
          </div>
        </div>
        </div>
    );
  }
}

export default App;
